(function() {   
    
    var teamData={};
    var loadInstance=$.modal.loading({message:"加载数据中..."});
    $.getJSON('getTeam',{pageNo:1,pageSize:50},function(data){
    	teamData.data=data.data;
    	$.bindData.compileAll($('#teamEle'),teamData);
    	loadInstance.open.then(function(){                
                loadInstance.close();
            });
    });

})()